import logo from "./logo.svg";
import "./App.css";
import About from "./pages/About";
import Gallary from "./pages/Gallary";
import { BrowserRouter, Route, Switch } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <ul>
          <li>
            <Link to="/about">
              <About />
            </Link>
          </li>
          <li>
            <Link to="/">
              <Gallary />
            </Link>
          </li>
        </ul>
      </div>
    </BrowserRouter>
  );
}

export default App;
